import Content from "./content";
import ContMess from "./contMess";
import "./conversationScreen.css";

function Messages() {
  return (
    <div className="messagesWrapper">
      <Content />
      <ContMess />
      <ContMess mine={true} />
      <ContMess />
      <ContMess mine={true} />
      <ContMess />
      <ContMess mine={true} />
    </div>
  );
}
export default Messages;
